// TwitterContainer.js
import React, { useEffect } from "react";
import { ISvgRectProps } from "../types/types";
import { defaultColor, selectedColor } from "../utils/MapStyles";

const SvgRect = (props: ISvgRectProps) => {

    const {
        width,
        height,
        fillColor,
        strokeColor,
        strokeWidth,
        fillOpacity,
        strokeOpacity,
    } = props

    return (
        <>
            <svg width={width} height={height} >
                <rect
                    width={width}
                    height={height}
                    fill={fillColor}
                    strokeWidth={strokeWidth}
                    stroke={strokeColor}
                    fillOpacity={fillOpacity}
                    strokeOpacity={strokeOpacity}
                />
            </svg>
            <p className='layerlabel'>visited</p>
        </>
    );
};

export default SvgRect;
